const _apiUrl = "/api/patrons";

// Get patrons
export const getPatrons = () => {
    return fetch(_apiUrl).then((r) => r.json());
  };

// Get a single patron
export const getPatron = (id) => {
    return fetch(`${_apiUrl}/${id}`).then((r) => r.json());
  };
